import ExpenseItem from './ExpenseItem';
import './Expense.css';

function Expenses(props) {

  return (
    <div className="expenses">
      <ExpenseItem title={props.info[0].title} amount={props.info[0].amount} date={props.info[0].date}></ExpenseItem>
      <ExpenseItem title={props.info[1].title} amount={props.info[1].amount} date={props.info[1].date}></ExpenseItem>
      <ExpenseItem title={props.info[2].title} amount={props.info[2].amount} date={props.info[2].date}></ExpenseItem>
    </div>
  );
}

export default Expenses;
